/**
 * Dynamically applies or replaces CSS in the DOM.
 * @param {string} cssString - The CSS rules as a string or URL.
 * @param {string} styleId - The unique id to assign to the style or link element.
 */
const applyCssToDom = (cssString, styleId) => {
  // Check if the input is a URL
  const isUrl = cssString.startsWith("http://") || cssString.startsWith("https://");

  // Check if an element with the given id already exists
  let styleElement = document.getElementById(styleId);

  if (styleElement) {
    // If a style/link element already exists, update it
    if (isUrl && styleElement.tagName === 'LINK') {
      styleElement.href = cssString;
    } else if (!isUrl && styleElement.tagName === 'STYLE') {
      if (styleElement.styleSheet) {
        styleElement.styleSheet.cssText = cssString; // For IE support
      } else {
        styleElement.innerHTML = cssString; // For modern browsers
      }
    }
  } else {
    // Create a new element based on whether it's a URL or raw CSS
    if (isUrl) {
      styleElement = document.createElement('link');
      styleElement.rel = 'stylesheet';
      styleElement.href = cssString;
    } else {
      styleElement = document.createElement('style');
      styleElement.type = 'text/css';

      if (styleElement.styleSheet) {
        styleElement.styleSheet.cssText = cssString; // For IE support
      } else {
        styleElement.appendChild(document.createTextNode(cssString));
      }
    }

    // Set the id and append the new style/link element to the head
    styleElement.id = styleId;
    document.head.appendChild(styleElement);
  }
};



const setFieldFocus = (id) => {
    const element = document.getElementById(id);
    if (element) {
        element.focus();
    }
}

const makePasswordToggle = (id) => {
    let container = document.getElementById(id);

    if (container) {
        let password = container.getElementsByTagName("input")[0];
        let toggler = document.createElement("button");
        toggler.setAttribute("type", "button");
        toggler.setAttribute("aria-label", "Show/Hide Password");
        toggler.className = "btn mdi mdi-eye-off-outline position-absolute end-0 top-50 translate-middle-y";
        container.appendChild(toggler);

        function showHidePassword() {
            if (password.type == "password") {
                password.setAttribute("type", "text");
                toggler.classList.add("mdi-eye-outline");
                toggler.classList.remove("mdi-eye-off-outline");
            } else {
                toggler.classList.add("mdi-eye-off-outline");
                toggler.classList.remove("mdi-eye-outline");
                password.setAttribute("type", "password");
            }
            password.focus();
        };

        toggler.addEventListener("click", showHidePassword);
    }
}

const start = () => {
    const theme = `
    {{global.variables.flowTheme}}
    `

    applyCssToDom(theme, 'experienceBuilder')

    makePasswordToggle("passwordDiv");
    setFieldFocus("username")
}

if (document.readyState === "loading") {
    // Loading hasn't finished yet
    document.addEventListener("DOMContentLoaded", start);
} else {
    // `DOMContentLoaded` has already fired
    start();
}

