}

/**
 * Processes the given parameters to extract specific values from a nested JSON object.
 * It verifies that the JSON object is valid and non-empty before extracting values for various fields.
 * 
 * @param {Object} params - The parameters object.
 * @param {Object} params.configJson - The JSON object from which values are to be extracted.
 * @returns {Object|boolean} - An object containing extracted values or `false` if `configJson` is invalid.
 */
module.exports = flowSettings = async ({ params }) => {
  let { configJson, appOrigin } = params;

  // Check configuration version
  configJson = checkConfigCompatibility(configJson, "1.0.1");

  if (!configJson) {
    return false;
  }

  let companyName, companyLogoUrl, showLogo;
  let riskId, riskEnabled;
  let mfaEnabled;
  let registrationEnabled;
  let accountRecoveryEnabled;
  let rpid, origin;
  let socialEnabled
  let socialFacebookEnabled, socialGithubEnabled, socialGoogleEnabled, socialMicrosoftEnabled
  let style;

  if (configJson !== null && typeof configJson === 'object' && !Array.isArray(configJson) && Object.keys(configJson).length > 0) {
    companyName = extractValueByPath(configJson, 'branding.companyName');
    companyLogoUrl = extractValueByPath(configJson, 'branding.companyLogoUrl');
    showLogo = extractValueByPath(configJson, 'branding.showLogo');
    riskId = extractValueByPath(configJson, 'risk.id');
    riskEnabled = extractValueByPath(configJson, 'risk.enabled');
    mfaEnabled = extractValueByPath(configJson, 'mfa.enabled');
    registrationEnabled = extractValueByPath(configJson, 'selfservice.enableRegistration');
    accountRecoveryEnabled = extractValueByPath(configJson, 'selfservice.enableAccountRecovery');
    rpid = createRpidFromOrigin(appOrigin) || extractValueByPath(configJson, 'webauthn.rpid');
    origin = appOrigin || extractValueByPath(configJson, 'webauthn.origin');
    socialEnabled = extractValueByPath(configJson, 'social.enabled');
    socialFacebookEnabled = extractValueByPath(configJson, 'social.providers.facebook');
    socialGithubEnabled = extractValueByPath(configJson, 'social.providers.github');
    socialGoogleEnabled = extractValueByPath(configJson, 'social.providers.google');
    socialMicrosoftEnabled = extractValueByPath(configJson, 'social.providers.microsoft');
    style = extractValueByPath(configJson, 'branding.style') || buildCSSFromParameters(configJson);
  }

  return {
    // Basic Company Info
    companyName,
    companyLogoUrl,
    showLogo,

    // Risk and Security Settings
    riskId,
    riskEnabled,
    mfaEnabled,
    registrationEnabled,
    accountRecoveryEnabled,

    // Web Authentication Details
    rpid,
    origin,

    // Social Media Settings
    socialEnabled,
    socialFacebookEnabled,
    socialGithubEnabled,
    socialGoogleEnabled,
    socialMicrosoftEnabled,

    // Styling (css or url)
    style
  };

}

/**
 * Checks configuration compatibility based on version and required attributes.
 * 
 * @param {Object} config - The configuration object.
 * @param {string} minRequiredVersion - The minimum required version (e.g., "1.0.0").
 * @param {Object} defaultValues - An object containing default values for any new attributes.
 * @returns {Object|null} - Returns the enriched config if compatible, or null if incompatible.
 */
function checkConfigCompatibility(config, minRequiredVersion, defaultValues = {}) {
  if (!isVersionCompatible(config.version, minRequiredVersion)) {
    console.error(`Incompatible config version: ${config.version}`);
    return null;
  }

  // Enrich the config with default values for new attributes if theyre missing
  const enrichedConfig = { ...defaultValues, ...config };

  return enrichedConfig;
}

// Helper function to check version compatibility as previously defined
function isVersionCompatible(configVersion, minRequiredVersion) {
  const parseVersion = (version) => version.split('.').map(Number);

  const [configMajor, configMinor, configPatch] = parseVersion(configVersion);
  const [requiredMajor, requiredMinor, requiredPatch] = parseVersion(minRequiredVersion);

  if (configMajor > requiredMajor) return true;
  if (configMajor < requiredMajor) return false;

  if (configMinor > requiredMinor) return true;
  if (configMinor < requiredMinor) return false;

  return configPatch >= requiredPatch;
}

/**
 * Extracts the relying party ID (rpid) from a given origin URL.
 * The rpid is based on the hostname of the origin URL.
 * 
 * @param {string} originUrl - The origin URL (e.g., "https://auth.pingone.com").
 * @returns {string|null} - The relying party ID (hostname) or null if the URL is invalid.
 */
function createRpidFromOrigin(originUrl) {
  if (typeof originUrl !== 'string' || originUrl.trim() === '') {
    console.error("Invalid input: Please provide a valid URL string.");
    return null;
  }

  // Regular expression to match the hostname part of a URL
  const match = originUrl.trim().match(/^https?:\/\/([^\/?#]+)(?:[\/?#]|$)/i);
  return match ? match[1] : null;
}

/**
 * Extract a value from a nested JSON object based on a specified path.
 * @param {Object} obj - The JSON object to traverse.
 * @param {String} path - The path to the value in dot notation (e.g., "flowSettings.protect.id").
 * @returns {*} - The value at the specified path or null if the path does not exist.
 */
function extractValueByPath(obj, path) {
  // Split the path into individual keys
  const keys = path.split('.');
  let current = obj;

  // Traverse the object based on the path
  for (let key of keys) {
    if (current && current.hasOwnProperty(key)) {
      current = current[key];
    } else {
      // Return null if the path does not exist
      return null;
    }
  }

  return current;
}


/**
 * Converts a HEX color to RGB format.
 * @param {string} hex - The hex color value (e.g., '#ff0000' or 'ff0000').
 * @returns {string} The RGB color value in the format 'rgb(r, g, b)'.
 */
const hexToRgb = (hex) => {
  // Remove the leading '#' if it's present
  hex = hex.replace(/^#/, '');

  // Parse the hex values into RGB components
  let r, g, b;

  if (hex.length === 3) {
    // Handle shorthand hex values (e.g., '#f00')
    r = parseInt(hex[0] + hex[0], 16);
    g = parseInt(hex[1] + hex[1], 16);
    b = parseInt(hex[2] + hex[2], 16);
  } else if (hex.length === 6) {
    // Handle full-length hex values (e.g., '#ff0000')
    r = parseInt(hex.substring(0, 2), 16);
    g = parseInt(hex.substring(2, 4), 16);
    b = parseInt(hex.substring(4, 6), 16);
  } else {
    return "";
  }

  return `${r}, ${g}, ${b}`;
};

