/**
 * Determines the next step in the authentication process based on MFA and Adaptive Authentication (Risk) settings.
 * 
 * @param {Object} params - The input parameters.
 * @param {boolean} params.p1RiskEnabled - Indicates whether Adaptive Authentication (Risk) is enabled.
 * @param {boolean} params.p1MFAEnabled - Indicates whether Multi-Factor Authentication (MFA) is enabled.
 * 
 * @returns {Promise<Object>} - An object containing the next step in the authentication process.
 * 
 * Possible next steps:
 * - "AUTHN_SUCCESS": If both MFA and Adaptive Authentication are disabled.
 * - "MFA": If MFA is enabled but Adaptive Authentication is disabled.
 * - "ERROR": If MFA is disabled but Adaptive Authentication is enabled (since Adaptive requires MFA).
 * - "ADAPTIVE": If both MFA and Adaptive Authentication are enabled.
 */
module.exports = nextStep = async ({ params }) => {
    const { p1RiskEnabled, p1MFAEnabled } = params;

    let nextStep;

    // Case 1: Both MFA and Adaptive Authentication are disabled
    if (!p1MFAEnabled && !p1RiskEnabled) {
        nextStep = "AUTHN_SUCCESS";
    }

    // Case 2: MFA is enabled and Adaptive Authentication is disabled
    if (p1MFAEnabled && !p1RiskEnabled) {
        nextStep = "MFA";
    }

    // Case 3: MFA is disabled and Adaptive Authentication is enabled
    if (!p1MFAEnabled && p1RiskEnabled) {
        nextStep = "ERROR";
    }

    // Case 4: Both MFA and Adaptive Authentication are enabled
    if (p1MFAEnabled && p1RiskEnabled) {
        nextStep = "ADAPTIVE";
    }

    return { nextStep };
};

