/**
 * Sorts an input array based on a desired order, placing any unmatched items at the end of the array.
 * This function is designed to work with input provided via parameters, specifically for sorting authentication methods
 * or similar lists according to a predefined priority order.
 *
 * @param {Array<string>} params.inputArray - The array of strings to be sorted, representing items like authentication methods.
 * @param {Array<string>} params.desiredOrder - An array of strings defining the desired order of the elements in the inputArray.
 *    Elements not listed in desiredOrder will be placed at the end of the returned array.
 * @returns {Promise<Object>} A promise that resolves to an object containing the sorted array. The resolved object has a
 *    property named 'sortedArray' which is the array sorted according to the desired order.
 *
 * @example
 * const params = {
 *    inputArray: ["SMS", "VOICE", "EMAIL", "TOTP", "FIDO2", "SECURITY_KEYS"],
 *    desiredOrder: ["TOTP", "EMAIL", "FIDO2", "SMS", "VOICE"]
 * };
 * sortArrayAsync({params}).then(sorted => console.log(sorted));
 * 
 * // Output: { sortedArray: ["TOTP", "EMAIL", "FIDO2", "SMS", "VOICE", "SECURITY_KEYS"] }
 */
module.exports = a = async ({params}) => {
    const {inputArray, desiredOrder} = params;
	let sortedArray;

    // Function to sort based on desired order, unmatched items placed at the end
    function sortBasedOnOrder(array, order) {
        const orderMap = new Map(order.map((item, index) => [item, index]));
        const lastOrderIndex = order.length;

        return array.sort((a, b) => {
            const orderA = orderMap.has(a) ? orderMap.get(a) : lastOrderIndex;
            const orderB = orderMap.has(b) ? orderMap.get(b) : lastOrderIndex;
            return orderA - orderB;
        });
    }

	if (desiredOrder) {
        sortedArray = inputArray && desiredOrder ? sortBasedOnOrder(inputArray, desiredOrder) : [];
	} else {
		sortedArray = inputArray
    }
    return {'sortedArray': sortedArray};
}

